package algorithm_1100

import "testing"

func Test_maxNumberOfBalloons(t *testing.T) {
	type args struct {
		text string
	}
	tests := []struct {
		name string
		args args
		want int
	}{
		{"t1", args{"nlaebolko"}, 1},
		{"t2", args{"loonbalxballpoon"}, 2},
		{"t3", args{"leetcode"}, 0},
		{"t4", args{"lloo"}, 0},
		{"t5", args{"balon"}, 0},
		{"t6", args{""}, 14},
		{"t7", args{""}, 10},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := maxNumberOfBalloons(tt.args.text); got != tt.want {
				t.Errorf("maxNumberOfBalloons() = %v, want %v", got, tt.want)
			}
		})
	}
}
